window.bookSummaryJSON = "<p>What power awaits those who collect the three Runestones of Tritinakh?</p> <p>With Kodai and the Shinigami tracking their every move, the best guild this side of Porthos takes the ultimate quest, pitting them against shamans, ice goddesses, stinky giants, and dangerous bugbears.</p> <p>In real world Tokyo, FeeTwix and Sophia arrive to join Ryuk in uncovering the truth of his hallucinations. What they discover is something is a game changer, to say the least.</p> <p>Even with the discovery, and the possibility of obtaining the Runestones, the Mitherfickers will still need help in defeating the Shinigami. It's time to call in some old friends, and bring a legendary gamer out of retirement.</p> <p><i>The Soundbooth Theater team for this production:</i></p> <p>Jeff Hays - Narration <br> Annie Ellicott - Gadsaa Shane, Sugar Spur, Skadi, Cafe Maid <br> Griffin Malnar - Proofing and Editing <br> Justin Thomas James - Production, Editing, Mastering, Sound Design</p>"; 
